import React from 'react'
import { NoteConsumer } from '../context'
import Note from './Note'

export default function NoteList() {
    return (
        <React.Fragment>

            <div className="row">
              <NoteConsumer>
                {(value) => {
                   return value.notes.map( note => {
                     return < Note key={note.id} note={note} />
                   })
                }}
              </NoteConsumer>
            </div>

           </React.Fragment>
    )
}
